/**
  * @brief  get the chinese characters data.
  * @param  gbk: chinese characters GBK code.
  *         buf: data.
  * @retval none.
  */
void chinese_font_24x24_read(uint8_t *gbk, uint8_t *buf)
{
  uint16_t i, temp;

  memset(buf, 0xFF, 72);

  for(i = 0; i < 3500; i++)
  {
    temp = (gbk[0] << 8) + gbk[1];

    /* find words with the same GBK encoding */
    if(temp == chinese_gbk_table[i])
    {
      memcpy(buf, chinese_gbk_data[i], 72);

      break;
    }
  }
}

